    "Breakpoint for a new line, Only insert this in the Text": {"en": "Breakpoint for a new line, Only insert this in the Text", "de": "Haltepunkt für eine neue Zeile. Fügen Sie diesen nur in den Text ein", "ru": "Точка останова для новой строки. Вставьте ее только в текст.", "pt": "Ponto de interrupção para uma nova linha, insira apenas isso no texto", "nl": "Breekpunt voor een nieuwe regel. Voeg dit alleen in de tekst in", "fr": "Point d'arrêt pour une nouvelle ligne, insérez-le uniquement dans le texte", "it": "Punto di interruzione per una nuova riga, inseriscilo solo nel testo", "es": "Punto de interrupción para una nueva línea, solo inserte esto en el texto", "pl": "Punkt przerwania nowej linii. Wstaw go tylko w tekście", "uk": "Точка зупину для нового рядка, вставте це лише в текст", "zh-cn": "新行的断点，仅将其插入文本中"},
