    "LastChange. Converts a Unix timestamp to a local time, the format can be changed, for example to DD.MM.YYYY YY hh:mm:ss:sss": {"en": "LastChange. Converts a Unix timestamp to a local time, the format can be changed, for example to DD.MM.YYYY YY hh:mm:ss:sss", "de": "Letzte Bearbeitung. Konvertiert einen Unix-Zeitstempel in eine lokale Zeit. Das Format kann geändert werden, beispielsweise in TT.MM.JJJJ JJ hh:mm:ss:sss", "ru": "Последнее изменение. Преобразует временную метку Unix в местное время, формат можно изменить, например, на ДД.ММ.ГГГГ ГГ чч:мм:сс:сс", "pt": "Última mudança. Converte um carimbo de data/hora Unix em uma hora local, o formato pode ser alterado, por exemplo, para DD.MM.AAAA AA hh:mm:ss:sss", "nl": "Laatste wijziging. Converteert een Unix-tijdstempel naar een lokale tijd, het formaat kan worden gewijzigd, bijvoorbeeld naar DD.MM.JJJJ JJ uu:mm:ss:sss", "fr": "Dernier changement. Convertit un horodatage Unix en heure locale, le format peut être modifié, par exemple en DD.MM.YYYY YY hh:mm:ss:sss", "it": "Ultima modifica. Converte un timestamp Unix in un'ora locale, il formato può essere modificato, ad esempio in GG.MM.AAAA AA hh:mm:ss:sss", "es": "Ultimo cambio. Convierte una marca de tiempo de Unix a una hora local; el formato se puede cambiar, por ejemplo a DD.MM.AAAA AA hh:mm:ss:sss", "pl": "Ostatnia zmiana. Konwertuje znacznik czasu Uniksa na czas lokalny, format można zmienić na przykład na DD.MM.RRRR YY gg:mm:ss:sss", "uk": "LastChange. Перетворює мітку часу Unix на місцевий час, формат можна змінити, наприклад, на ДД.ММ.РРРР РР год:хх:сс:сс", "zh-cn": "最后一次变更。将 Unix 时间戳转换为本地时间，格式可以更改，例如 DD.MM.YYYY YY hh:mm:ss:sss"},
