    "Select a Menu": {                                "en": "Select a Menu",                                    "de": "Wählen Sie ein Menü aus",                          "ru": "Выберите меню",                                    "pt": "Selecione um cardápio",                            "nl": "Selecteer een menu",                               "fr": "Sélectionnez un menu",                             "it": "Seleziona un menu",                                "es": "Seleccione un menú",                               "pl": "Wybierz menu",                                     "uk": "Виберіть меню",                                    "zh-cn": "选择菜单"},
    "Select a Menu, move or copy. Attention! A user must be active in the selected menu!": {"en": "Select a Menu, move or copy. Attention! A user must be active in the selected menu!", "de": "Wählen Sie ein Menü aus, verschieben oder kopieren Sie es. Aufmerksamkeit! Im ausgewählten Menü muss ein Benutzer aktiv sein!", "ru": "Выберите меню, переместите или скопируйте. Внимание! Пользователь должен быть активен в выбранном меню!", "pt": "Selecione um menu, mova ou copie. Atenção! Um usuário deve estar ativo no menu selecionado!", "nl": "Selecteer een menu, verplaats of kopieer. Aandacht! Er moet een gebruiker actief zijn in het geselecteerde menu!", "fr": "Sélectionnez un menu, déplacez ou copiez. Attention! Un utilisateur doit être actif dans le menu sélectionné !", "it": "Seleziona un menu, sposta o copia. Attenzione! Un utente deve essere attivo nel menu selezionato!", "es": "Seleccione un menú, mueva o copie. ¡Atención! ¡Un usuario debe estar activo en el menú seleccionado!", "pl": "Wybierz menu, przenieś lub skopiuj. Uwaga! Użytkownik musi być aktywny w wybranym menu!", "uk": "Виберіть меню, перемістіть або скопіюйте. Увага! Користувач повинен бути активним у вибраному меню!", "zh-cn": "选择一个菜单，移动或复制。注意力！用户必须在所选菜单中处于活动状态！"},
    "Select a Menu,select move or copy. Watch out! A user must be active in the selected menu!": {"en": "Select a Menu,select move or copy. Watch out! A user must be active in the selected menu!", "de": "Wählen Sie ein Menü, wählen Sie „Verschieben“ oder „Kopieren“. Achtung! Im ausgewählten Menü muss ein Benutzer aktiv sein!", "ru": "Выберите меню, выберите перемещение или копирование. Осторожно! Пользователь должен быть активен в выбранном меню!", "pt": "Selecione um menu, selecione mover ou copiar. Atenção! Um usuário deve estar ativo no menu selecionado!", "nl": "Selecteer een menu, selecteer verplaatsen of kopiëren. Kijk uit! Er moet een gebruiker actief zijn in het geselecteerde menu!", "fr": "Sélectionnez un menu, sélectionnez déplacer ou copier. Attention! Un utilisateur doit être actif dans le menu sélectionné !", "it": "Seleziona un menu, seleziona sposta o copia. Attento! Un utente deve essere attivo nel menu selezionato!", "es": "Seleccione un menú, seleccione mover o copiar. ¡Cuidado! ¡Un usuario debe estar activo en el menú seleccionado!", "pl": "Wybierz menu, wybierz opcję przenieś lub skopiuj. Uważaj! Użytkownik musi być aktywny w wybranym menu!", "uk": "Виберіть меню, виберіть перемістити або скопіювати. Стережись! Користувач повинен бути активним у вибраному меню!", "zh-cn": "选择一个菜单，选择移动或复制。小心！用户必须在所选菜单中处于活动状态！"},
